(353, NULL, '', NULL, 'Jerônimo Cardoso', 'Jerônimo Cardoso', NULL, 'c1510', NULL, '1569', '"mestre degramática em Lisboa a partir do primeiro terço doséc. XVI. Nascido em Lamego (c. 1508, now(), now()), estegramático colhe formação na universidade deSalamanca. Daí regressa em 1530 e logo deve terpassado a ensinar em Lisboa, próximo daUniversidade; os bons resultados conseguidosdevem ter-lhe assegurado reputação, pois logo em1536 é cooptado para proferir a oratio sapientiaeno início do ano escolar na Universidade. Teráplaneado deslocar-se a Paris, para aí frequentar auniversidade, esperançado possivelmente emusufruir de alguma bolsa de estudo que o rei D.João III concedia por esses tempos, mas não pareceque o tenha feito."(Aires A. Nascimento)http://ww3.fl.ul.pt/biblioteca/biblioteca_digital/docs/res93.pdf', now(), now()),
